import Navbar from "../components/NavBar";
import fotocamera from "../asserts/fotocamera.jpg";

import "./msu_style.css";
import { useState } from "react";



export default function MobileSignUp(){
    const [state, setState] = useState("true");
    return (
        <>
            <Navbar/>
            <div className="mobile-container">
                <div className="mobile-sign-up">
                    <h1>Sign Up to Verne</h1>
                <form>
                    <label >Name</label>
                    <input placeholder="Name"/>
                    <label >Email</label>
                    <input type='email' placeholder="example@domain.com"/>
                    <label >Password</label>
                    <input type='password' placeholder="Password"/>
                </form>
                </div>
                <button onClick={()=>setState(true)}>Sign Up with Documents <i className="fa-solid" /></button>
                <div fotocamera hidden={state}>
                    <h3></h3>
                </div>
            </div>
        </>
    );
}
